import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Residents() {
  const [residents, setResidents] = useState([]);

  useEffect(() => {
    // Fetch residents data from the backend API
    const fetchResidents = async () => {
      try {
        const response = await axios.get('http://192.168.164.157:8000/login');
        setResidents(response.data);
      } catch (error) {
        console.error('Error fetching residents:', error);
      }
    };

    fetchResidents();
  }, []);

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '20px' }}>
      <h2>Residents</h2>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        {residents.map(resident => (
          <li key={resident.email} style={{ marginBottom: '10px' }}>
            <div>Email: {resident.email}</div>
            <div>Password: {resident.password}</div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Residents;
